import React from 'react';
import './Navbar.css';
import logo from '../../assets/img/mblogo_long_wd.png';

const navbar = (props) => {

    if(!props.showModal) { 
        return (
            <div className='nav_nav'>
                <nav className="navbar navbar-light bg-light">
                    <a href='http://www.mongobyte.com'>
                    <img src={logo}  className="d-inline-block align-top" alt=""></img></a>
                        <ul className="nav_ul">
                            <li><a href='#'>Find a Brewery</a></li>
                            <li><a href='#'>About MongoByte</a></li>
                            <li><a href='../../containers/Contact/'>Contact Us</a></li>
                        </ul> 
                </nav>
            </div>
        );
    };

        return (
            <div className='nav_nav'>
                <nav className="navbar navbar-light bg-light">
                    <img src={logo}  className="d-inline-block align-top" alt="" />
                    <ul className="nav_ul">
                        <li>Find a Brewery</li>
                        <li>About MongoByte</li>
                        <li>Contact Us</li>
                    </ul> 
                </nav>
            </div>
        );
    };


export default navbar;
